(function(){const e=document.getElementById("konten_tag_js"),n=document.getElementById("konten_tag_css"),t=document.getElementById("konten_import_css");fetch("../data/lists.json").then(e=>e.json()).then(d=>{e.innerHTML="",n.innerHTML="",t.innerHTML="",Object.keys(d).forEach(s=>{const r=d[s];let c=document.createElement("div");c.classList.add("list"),c.innerHTML=`\n            <p>Versi: ${r.kode_versi}</p>\n            <pre><code></code></pre>\n            `,c.querySelector("code").innerText=r.tag_script,e.appendChild(c);let i=document.createElement("div");i.classList.add("list"),i.innerHTML=`\n            <p>Versi: ${r.kode_versi}</p>\n            <pre><code></code></pre>\n            `,i.querySelector("code").innerText=r.tag_stylesheet,n.appendChild(i);let o=document.createElement("div");o.classList.add("list"),o.innerHTML=`\n            <p>Versi: ${r.kode_versi}</p>\n            <pre><code></code></pre>\n            `,o.querySelector("code").innerText=r.import_stylesheet,t.appendChild(o)})})})();